const input = $input.first().json;
const languages = input.targetLanguages || ['en'];

const validLanguages = ['en', 'ja', 'de', 'fr', 'es', 'zh', 'ko', 'pt', 'it', 'nl', 'pl', 'ru'];
const normalizedLangs = languages.filter(l => validLanguages.includes(l.toLowerCase()));

if (normalizedLangs.length === 0) {
  throw new Error('No valid target languages specified');
}

const sourceText = input.sourceText || '';
let detectedSource = 'en';
if (/[\u3040-\u30ff\u4e00-\u9fff]/.test(sourceText)) detectedSource = 'ja';
else if (/[\u0400-\u04ff]/.test(sourceText)) detectedSource = 'ru';

return [{
  json: {
    ...input,
    detectedSourceLang: detectedSource,
    validatedTargetLangs: normalizedLangs,
    languageCount: normalizedLangs.length
  }
}];

