const input = $input.first().json;
const aiOutput = input.output || '{}';
const translationData = $('Process Translation Result').first().json;

let qualityData = { score: 7, issues: [], suggestions: [] };
try {
  const jsonMatch = aiOutput.match(/\{[\s\S]*\}/);
  if (jsonMatch) qualityData = JSON.parse(jsonMatch[0]);
} catch (e) {}

return [{
  json: {
    ...translationData,
    qualityScore: qualityData.score || 7,
    issues: qualityData.issues || [],
    suggestions: qualityData.suggestions || [],
    needsReview: (qualityData.score || 7) < 6
  }
}];

